    false,nt"url": null,nt"notes": "This narrative report for Blackwater Migratory
    Bird Refuge outlines Refuge accomplishments from August through October of 1939.
    The report begins by summarizing the weather conditions during this period. Wildlife-
    including migratory birds and upland game birds- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include timber removal. The public relations section
    of the report describes Refuge visitors.",nt"license_title": "License Not
